    return (
      <div id="map"></div>
    );
  }
}

class Articles extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div id="articles"></div>
    );
  }
}

class SceneThree extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <div id="scene-three">
        <Map />
        <Articles />
      </div>
    );
  }
}

export default SceneThree;
